import React, { Component } from 'react'
import styled from "styled-components";
import {Link} from 'react-router-dom';
import { withRouter } from 'react-router-dom'
import { BrowserRouter, Route } from 'react-router-dom'
import { Redirect } from 'react-router-dom'
import jwt_decode from 'jwt-decode'



class Navbar extends Component {

    constructor(props) {
        super(props)
    }

    logout(e) {

        console.log("length "+jwt_decode(localStorage.usertoken).length)
        e.preventDefault()
        localStorage.removeItem('usertoken')
        this.props.history.push('/')
      }


    render() {
        let link;
        if(localStorage.usertoken){
        let token = jwt_decode(localStorage.usertoken);
            link = <div class="container-fluid">
                <div class="navbar-header">
                  <a class="navbar-brand" href="#">WebSiteName</a>
                </div>
                <ul class="nav navbar-nav">
                  <li class="active"><Link to="#">Home</Link></li>
                  <li><Link to="/cart">Page 1</Link></li>
                  <li><Link to="/courses">Page 2</Link></li>
                </ul>
                <ul class="nav navbar-nav navbar-right">
                  <li><Link to="#"><span class="glyphicon glyphicon-log-out" onClick={this.logout.bind(this)}>
                  </span>
                   Logout</Link></li>
                </ul>
                </div>;
    }
        return (

            <nav class="navbar navbar-inverse">
                        {localStorage.usertoken ? (
                            <div>
                                 { link }
                                </div>

                        ) : (
                                    <div class="container-fluid">
                <div class="navbar-header">
                  <a class="navbar-brand" href="#">WebSiteName</a>
                </div>
                <ul class="nav navbar-nav">
                  <li><Link to="/">Home</Link></li>
                </ul>
                <ul class="nav navbar-nav navbar-right">
                  <li><Link to="/register"><span class="glyphicon glyphicon-user"></span> Sign Up</Link></li>
                  <li><Link to="/login"><span class="glyphicon glyphicon-log-in"></span> Login</Link></li>
                </ul>
              </div>

                            )}
                   </nav>

        );

    }
}

export default withRouter(Navbar);
